const Card = () => {
    return (
        <div>
            <img alt="robots" src='https://robohash.org/testtest.png?size=200x200'/>
            <img alt="robots" src='https://robohash.org/testtest.png?ignoreext=false'/>
            <img alt="robots" src='https://robohash.org/manipanneeru25@gmail.com'/>
            <div>
                <h2>Jane Doe</h2>
                <p>jane.doe@gmail.com</p>
            </div>
        </div>

    )
};

export default Card;
